//import React from "react"
import Navbar from "../../components/Navbar/Navbar"
import Header from "../../components/Header/Header"

import React, { Component } from 'react'
//import Draggable from "react-draggable"
import Select from "react-select"
import './CourseRoad.css'

export default class CourseRoad extends Component {

  constructor(){
    super()
    this.state={
      SelectedDep : ""
    }
  }
  render() {
    const options = [{
      "name": "CS", "label":"CS"
    }]
    return (
      <div>
        <Navbar/>
        <Header pos="CourseRoad"/>
        <div className="DeptSelectWindow">
          <div className="DeptSelectQs">Department:</div>
          <Select options={options} placeholder="Select"/>
          <div className="DeptSelectQs">Add Major:</div>
          <Select placeholder="Select"/>
          <div className="DeptSelectQs">Add Minor:</div>
          <Select placeholder="Select"/>
          <div className="DeptSelectOkbtn" onClick={()=>this.han}>Ok</div>
        </div>
      </div>
    )
  }
}
